INSERT INTO `artikel` (`id`, `judul`, `keterangan`, `konten`, `foto`, `tanggal`) VALUES
(33, 'Program Kosabangsa Amikom-Akprind Maksimalkan Potensi Pariwisata di Bleberan Gunungkidul', 'Universitas Amikom Yogyakarta dan Universitas Akprind Indonesia menjadi perguruan tinggi pelaksana dan pendamping program Kosabangsa 2024. Kegiatan ini didukung dan didanai oleh Kemendibud dengan tanggal kontrak Induk 6/09/2024, nomor kontrak induk 009/E5/PG.02.00/KOSABANGSA/2024, tanggal kontrak turunan 10/09/2024 dan nomor kontrak turunan 2615.2/LL5-INT/AL.04/2024.', 'REPUBLIKA.CO.ID, GUNUNGKIDUL -- Desa Bleberan di Gunungkidul, Daerah Istimewa Yogyakarta, memiliki potensi besar dalam sektor pariwisata dan ekonomi kreatif. Salah satu aset utamanya adalah Sungai Oyo, yang menawarkan keindahan alam dan potensi edukasi yang luar biasa.\r\n\r\nNamun, untuk memaksimalkan potensi besar tersebut, diperlukan strategi pemasaran digital yang efektif guna meningkatkan kesadaran akan pentingnya pengelolaan air bersih yang dikelola oleh kelompok Pengelola Air Bersih (PAB) Sejahtera Bleberan dan mempromosikan wisata edukasi di Sungai Oyo yang dikelola oleh Kelompok Sadar Wisata (Pokdarwis).\r\n\r\nDalam meningkatkan potensi tersebut terdapat beberapa permasalahan, seperti, kapasitas SDM, pengembangan insftarustur dan fasilitas wisata (fasilitas umum, fasilitas penunjang dan pengembangan Lokasi wisata yang menarik) serta peningkatan pemasaran digital.\r\n\r\nMelalui program Kosabangsa tahun 2024, Universitas Amikom Yogyakarta menjadi perguruan tinggi pelaksana yang diketuai oleh Prof. Dr. Ema Utami, S.Si., M.Kom. dan beranggotakan Yusuf Amri Amrullah, S.E., M.M. serta Gardyas Bidari Adninda, S.T., M.A. dan Universitas Akprind Indonesia sebagai pendamping yang diketuai oleh Dr. Suwanto Suharjo ,S.Si., M.Kom. dan beranggotakan Catur Iswahyudi, S.Kom., S.E., M.Cs., MTA. serta Purnawan, S.T., M.Eng., C.WS. Kegiatan ini didukung dan didanai oleh Kemendibud dengan tanggal kontrak Induk 6/09/2024, nomor kontrak induk 009/E5/PG.02.00/KOSABANGSA/2024, tanggal kontrak turunan 10/09/2024 dan nomor kontrak turunan 2615.2/LL5-INT/AL.04/2024.\r\n\r\nSeperti diketahui, wisata saat ini juga menjadi tantangan secara nasional maupun internasional. Dengan dorongan pemerintah dalam mengembangkan pariwisata dan diberikan kemudahan dalam mengakses pendanaan maupun program-program yang diberikan, maka banyak bermunculan wisata-wisata baru sejenis. Dan dari Desa Bleberan perlu adanya peningkatan kapasitas dari berbagi sisi untuk meningkatkan potensi yang sudah ada. Peningkatan ini berdasarkan permasalahan yang ditemukan oleh tim Kosabangsa.\r\n\r\n\"Potensi yang dimiliki oleh Desa Bleberan ini dapat mengangkat ekonomi kreatif desa dan dapat meningkatkan perekonomian masyarakat secara umum,\" ujar Prof Ema Utami dalam siaran persnya.\r\n\r\nMenurut Prof Ema, pengelolaan air bersih adalah isu krusial yang harus mendapatkan perhatian serius. Air bersih tidak hanya penting untuk kesehatan masyarakat, tetapi juga untuk keberlanjutan lingkungan dan ekonomi lokal.\r\n\r\n\"Sungai Oyo, sebagai salah satu sumber air utama di Desa Bleberan, harus dijaga kebersihannya agar dapat terus memberikan manfaat bagi masyarakat sekitar,\" katanya.\r\nProf Ema memaparkan, sungai Oyo tidak hanya menawarkan keindahan alam, tetapi juga potensi sebagai destinasi wisata edukasi. Wisata edukasi ini dapat mencakup kegiatan seperti pengamatan ekosistem sungai, belajar tentang flora dan fauna lokal, serta memahami pentingnya konservasi air.\r\n\r\n\"Dengan demikian, wisatawan tidak hanya menikmati keindahan alam, tetapi juga mendapatkan pengetahuan yang berharga,\" katanya.\r\n\r\nProf Ema menekankan, pemasaran digital tidak hanya bermanfaat untuk meningkatkan kesadaran akan pengelolaan air bersih dan wisata edukasi, tetapi juga dapat mengangkat ekonomi kreatif di Desa Bleberan. Produk-produk lokal seperti kerajinan tangan, makanan khas, dan produk kreatif lainnya dapat dipromosikan melalui platform digital. E-commerce dan media sosial dapat menjadi sarana efektif untuk menjangkau pasar yang lebih luas.\r\n\r\n\r\n\"Dengan strategi pemasaran digital yang tepat, produk-produk kreatif dari Desa Bleberan dapat dikenal oleh lebih banyak orang, baik di tingkat nasional maupun internasional. Hal ini tidak hanya meningkatkan pendapatan masyarakat lokal, tetapi juga memperkuat identitas budaya dan kreativitas desa,\" katanya.\r\n\r\nBerdasarkan temuan di lapangan bahwa terdapat pemasaran digital yang belum optimal, maka salah satu program tim yaitu tentang pelatihan pemasaran digital dirasa sangat perlu untuk dilakukan. Salah satu penekanan dalam pemasaran digital yaitu perlu adanya tim yang mengelola bagian digital, atau jika sudah ada perlu ditingkatkan kompetensinya dan diberikan kesadaran tentang pentingnya pengelolaan digital diera sekarang ini, di mana persaingan sudah tidak hanya skala nasional tapi juga skala internsional dalam mendatangkan wisatawan ke daerah. Beberapa hal yang perlu diperhatikan dalam pemasaran digital yaitu Pembuatan Konten Berkualitas, Optimalisasi SEO, Media Sosial, dan Analisis Data.\r\n\r\nHasil pelatihan ini yaitu pembuatan dan pendampingan website serta media sosial untuk Pokdarwis dan PAB Sejahtera Desa Bleberan. Dalam website akan diberikan informasi terkait dengan wisata edukasi yang ada di Sungai OYO serta perkembangannya dari setiap tahapan yang sudah dilakukan.\r\n\r\n\"Selain itu juga akan diberikan informasi terkait dengan pengelolaan air bersih dan kebermanfaatanya untuk warga masyarakat Desa Bleberan. Sehingga media informasi ini akan membantu para stakeholder dalam memantau atau bahkan membantu meningkatkan pemasaran,\" tutup Prof Ema.\r\nhttps://rejogja.republika.co.id/berita/smi6ns291/program-kosabangsa-amikom-akprind-maksimalkan-potensi-pariwisata-di-bleberan-gunungkidul', '30112024185831_674afde7b9eb5.png', '2024-11-30 11:58:31'),
(34, 'AMIKOM dan AKPRIND Beri Pendampingan Implementasi Inovasi Teknologi Tepat Guna di Playen', 'Untuk meningkatkan kesejahteraan masyarakat di Kalurahan Bleberan, Kecamatan Playen, Kabupaten Gunung Kidul, Universitas AMIKOM Yogyakarta dan Universitas AKPRIND Indonesia berkolaborasi melalui program Kosabangsa DRTM Ditjen Diktiristek 2024. Program ini mencakup berbagai kegiatan, termasuk perancangan solar sel untuk perahu wisata, instalasi pengelolaan air bersih, dan penerangan bertenaga solar sel di Goa Rancang Kencono.', 'REPUBLIKA.CO.ID, GUNUNGKIDUL -- Untuk meningkatkan kesejahteraan masyarakat di Kalurahan Bleberan, Kecamatan Playen, Kabupaten Gunung Kidul, Universitas AMIKOM Yogyakarta dan Universitas AKPRIND Indonesia berkolaborasi melalui program Kosabangsa DRTM Ditjen Diktiristek 2024. Program ini mencakup berbagai kegiatan, termasuk perancangan solar sel untuk perahu wisata, instalasi pengelolaan air bersih, dan penerangan bertenaga solar sel di Goa Rancang Kencono.\r\n\r\nPada tahap ini kegiatan sudah memasuki tahap pendampingan untuk keberlangsungan program terhadap mitra kelompok sadar wisata (POKDARWIS) dan mitra Pengelola Air Bersih (PAB) Sejahtera, Bleberan.\r\n\r\nPendampingan instalasi solar sel pada POKDARWIS dan instalasi alat filter air pada PAB Sejahtera dimulai dengan pelatihan intensif yang diberikan oleh para ahli dari Universitas AKPRIND Indonesia selaku Perguruan Tinggi Pendamping pada program Kosabangsa tahun 2024 Kalurahan Bleberan, Kecamatan Playen, Kabupaten Gunungkidul.\r\n\r\nMasyarakat setempat diajarkan tentang pentingnya energi terbarukan dan cara memanfaatkan sinar matahari sebagai sumber energi listrik. Solar sel ini saat ini sedang proses diimplementasikan pada perahu wisata Sungai Oyo untuk menggantikan perahu wisata bertenaga bahan bakar solar dan untuk penerangan di Goa Rancang Kencono. Tujuan kegiatan ini selain untuk menekankan tentang pentingnya energi terbarukan, juga untuk pendampingan dalam proses instalasi teknologi tepat guna (TTG) berbasis tenaga surya.\r\n\r\nInstalasi TTG pada PAB Sejahtera, program ini juga berfokus pada penambahan alat pengelolaan air bersih, sehingga menjadi air siap minum. Selama ini PAB Sejahtera masih menghadapi kendala terutama pada kandungan kesadahan yang tinggi dalam air yang ada, sehingga air memerlukan sentuhan teknologi agar dapat digunakan secara langsung sebagai air siap minum.\r\n\r\nUniversitas AMIKOM Yogyakarta sebagai Tim Pelaksana Kosabangsa bersama Universitas AKPRIND Indonesia sebagai Tim Pendamping Kosabangsa melakukan pengukuran kandungan kimia air dan menentukan TTG yang tepat untuk diimplementasikan di lokasi mitra program Kosabangsa ini. Dengan menerapkan TTG system water softener maka tingkat kesadahan dapat ditekan sehingga menghasilkan air siap minum. Air yang dihasilkan dapat kemudian dikemas dan dijual oleh PAB Sejahtera untuk meningkatkan pendapatan.\r\n\r\nInstalasi penerangan jalan umum (PJU) bertenaga solar sel di Goa Rancang Kencono, salah satu destinasi wisata unggulan di Kalurahan Bleberan juga dilakukan antara Tim Kosabangsa dan POKDARWIS Kalurahan Bleberan. Pemasangan lampu ini diharapkan bisa menambah kenyamanan saat diadakan aktivitas di malam hari Pemasangan lampu ini juga diharapkan dapat meningkatkan jumlah kunjungan wisatawan, yang pada gilirannya akan berdampak positif pada perekonomian lokal.\r\n\r\nDampak positif dan harapan ke depan, kolaborasi antara Universitas Universitas AMIKOM Yogyakarta dan Universitas AKPRIND Indonesia dalam program Kosabangsa DRTM Ditjen Diktiristek ini diharapkan membawa perubahan nyata bagi masyarakat Kalurahan Bleberan. \"Dengan adanya TTG energi terbarukan dan pengelolaan air bersih, kualitas hidup masyarakat diharapkan akan meningkat secara signifikan,\" ujar Ketua Tim Pelaksana Kosabangsa dari Universitas AMIKOM Yogyakarta, Prof Ema Utami.\r\nhttps://rejogja.republika.co.id/berita/sn48ga291/amikom-dan-akprind-beri-pendampingan-implementasi-inovasi-teknologi-tepat-guna-di-playen', '30112024190328_674aff10d6c68.jpg', '2024-11-30 12:03:28'),
(36, 'Program Kosabangsa Amikom dan Akprind di Playen Lalui Tahap Monev', 'Kelanjutan program Kosabangsa Universitas Amikom Yogyakarta dan Universitas Akprind Indonesia di Desa Bleberan di Kecamatan Playen, Gunungkidul, telah melalui tahap monitoring dan evalusi yang dilakukan secara internal melalui Lembaga Penelitian dan Pengabdian Masyarakat (LPPM). Kegiatan monitoring dan evaluasi (monev) dilaksanakan di Kampus 1 Universitas Akprind Indonesia yang beralamat di Kalisahak Nomor 28, Klitren, Kecamatan Gondokusuman, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55222.\r\n\r', 'REPUBLIKA.CO.ID, GUNUNGKIDUL -- Kelanjutan program Kosabangsa Universitas Amikom Yogyakarta dan Universitas Akprind Indonesia di Desa Bleberan di Kecamatan Playen, Gunungkidul, telah melalui tahap monitoring dan evalusi yang dilakukan secara internal melalui Lembaga Penelitian dan Pengabdian Masyarakat (LPPM). Kegiatan monitoring dan evaluasi (monev) dilaksanakan di Kampus 1 Universitas Akprind Indonesia yang beralamat di Kalisahak Nomor 28, Klitren, Kecamatan Gondokusuman, Kota Yogyakarta, Daerah Istimewa Yogyakarta 55222.\r\n\r\n\"Kegiatan monev ini dilakukan secara hibrida. Kelompok perguruan tinggi pelaksana dan perguruan tinggi pendamping berkumpul secara offline yang kemudian reviewer menggunakan Zoom Meeting,\" ujar Ketua Tim Pelaksana Kosabangsa, Prof Ema Utami, dalam siaran pers, Selasa (19/11/2024).\r\n\r\nKegiatan ini juga dihadiri oleh perwakilan dari Lembaga Penelitian dan Pengabdian Masyarakat (LPPM) kedua Perguruan Tinggi. Kedua tim pelaksana hadir semua dalam kegiatan monev internal ini yaitu Prof. Dr. Ema Utami, S.Si., M.Kom. selaku ketua pelaksana program dan beranggotakan Yusuf Amri Amrullah, S.E., M.M. serta Gardyas Bidari Adninda, S.T., M.A. dan Universitas Akprind Indonesia sebagai pendamping yang diketuai oleh Dr. Suwanto Suharjo ,S.Si., M.Kom. dan beranggotakan Catur Iswahyudi, S.Kom., S.E., M.Cs., MTA. serta Purnawan, S.T., M.Eng., C.WS. Reviewer pertama dari monev ini yaitu Prof.Dr.drh.R.Wisnu Nurcahyo dan reviewer kedua yaitu Dr. Dra.. Suparni Setyowati Rahayu, M.Si.\r\n\r\nProf Ema memaparkan hasil dari kegiatan yang telah dilaksanakan oleh kedua perguruan tinggi. Dalam pemaparannya beberapa kegiatan yang sudah dilakukan yaitu melakukan pelatihan, pendampingan, dan implementasi kegiatan seperti, pelatihan peningkatan pemasaran, perancangan solar cel, penentuan titik-titik untuk pembuatan PLTS dan lampu solar celnya.\r\n\r\nSelain itu juga disampaikan juga terkait dengan kendala dan solusi yang sudah ditemukan dan sudah dilakukan oleh kedua tim, secara umum tidak menemukan kendala berarti,\" kata Prof Ema yang merupakan dosen dari Universitas Amikom Yogyakarta.\r\n\r\nSalah satu kendala seperti penyesuaian solar cel di kapal untuk mengurangi pencemaran air Sungai, rancangan awal untuk kapal yang sudah ada tidak bisa dilakukan untuk kapal yang sudah ada, pada akhirnya sesuai kesepakatan dengan mitra dibuatlah kapal baru yang bisa disesuaikan penggunaanya. Kemudian disampaikan juga tentang titik lampu untuk goa rancang kencono yang sudah diimplementasikan di Lokasi, selain itu juga dipaparkan bahwa pengelolaan air bersih sudah diupgrading peralatannya dimana yang sebelumnya air yang dikelola memiliki kadar kapur, sekarang sudah tidak terdapat kandungan kapurnya.\r\n\r\nLuaran dari kegiatan Kosabangsa ini juga sudah memenuhi dari target yaitu, sudah memiliki poster, HKI, inovasi teknologi tepat guna, submit seminar nasional, submit jurnal terindeks Sinta 3, publikasi media massa, upload video di Youtube LPPM dan TV desa juga sudah dilakukan. Selain itu pada saat monev juga ditunjukkan video yang telah diunggah di Youtube LPPM, pemaparan dilakukan selama 15 menit dari presentasi dan menampilkan video hasil kegiatan.\r\n\r\nSelesai pemaparan dari ketua pelaksana, reviewer kemudian memberikan masukan terkait kegiatan yang sudah dilaksanakan. Masukan dari reviewer ini perlu menunjukkan detail pada setiap kegiatan perlu dilengkapi terkait dengan kegiatan kosabangsa. Hasil atau dampak positif dari kegiatan ini juga perlu ditunjukkan, serta memastikan dari keberlanjutan program kosabangsa tersebut. Dampak ekonomi ini perlu ditunjukkan sebagai bagian dari pengukuran program kosabangsa yaitu meningkatkan kesejahteraan perekonomian masyarakat bleberan, kecamatan playen, Kabupaten Gunungkdul.\r\n\r\nMonitoring dan evaluasi internal yang dilakukan oleh LPPM Universitas Amikom dan Universitas Akprind Indonesia telah memastikan keberhasilan program pemberdayaan pengelolaan air bersih dan pengembangan wisata eduwisata di Desa Bleberan. \"Program ini tidak hanya meningkatkan Kesejahteraan masyarakat tetapi juga membuka peluang ekonomi baru melalui pemanfaatan potensi wisata kalurahan bleberan,\" kata Prof Ema mengakhiri.\r\nhttps://rejogja.republika.co.id/berita/sn6cen291/program-kosabangsa-amikom-dan-akprind-di-playen-lalui-tahap-monev', '30112024191224_674b01288bfa8.jpg', '2024-11-30 12:12:24'),
(37, 'Program Kosabangsa Amikom dan Akprind Implementasikan Inovasi Teknologi pada PAB', 'Program Kosabangsa Universitas Amikom Yogyakarta dan Universitas Akprind Indonesia di Desa Bleberan, Kecamatan Playen, Gunungkidul, telah mencapai tahapan selanjutnya yaitu implementasi inovasi teknologi pada pengelolaan air bersih (PAB).', 'REPUBLIKA.CO.ID, GUNUNGKIDUL -- Program Kosabangsa Universitas Amikom Yogyakarta dan Universitas Akprind Indonesia di Desa Bleberan, Kecamatan Playen, Gunungkidul, telah mencapai tahapan selanjutnya yaitu implementasi inovasi teknologi pada pengelolaan air bersih (PAB).\r\n\r\nKalurahan Bleberan terletak di daerah yang memiiliki karakteristik tanah yang khas yaitu berada di daerah karst. Air tanah di daerah karst biasanya secara fisik jernih namun demikian mengandung mineral terlarut seperti kalsium karbonat (CaCOâ‚ƒ), yang membuat air bersifat keras (hard water) atau biasa disebut memiliki kesadahan tinggi, hasil uji laboratorium yang sudah dilakukan menunjukkan nilai kesadahan sebesar 324,9 mg/L.\r\n\r\n\"Dampak yang ditimbulkan oleh air dengan kesadahan tinggi akan menimbulkan kontaminasi tambahan atau rasa tidak enak pada makanan atau minuman. Sedangkan dampak terhadap kesehatan dalam jangka panjang dapat menyebabkan ketidaknyamanan pada sistem pencernaan serta berkontribusi pada pembentukan batu ginjal,\" kata Ketua Tim Pelaksana Kosabangsa dari Universitas AMIKOM Yogyakarta, Prof Ema Utami, dalam siaran persnya, Jumat (21/11/2024).\r\n\r\nUntuk memenuhi kebutuhan air minum di Bleberan, masyarakat masih menggunakan metode tradisional yaitu dengan cara pemanasan kemudian endapan kapur yang terbentuk disaring secara manual. Selain membutuhkan energi yang cukup besar dalam mengolah untuk menjadi air siap minum juga memerlukan beberapa tahapan.\r\n\r\nDari cara yang sudah dilakukan sebelumnya penurunan kesadahan belum optimal serta masih memberikan efek berupa timbulnya kerak pada peralatan masak dan pemanas air.\r\n\r\nAplikasi teknologi dari Program Kosabangsa yang dilakukan oleh Purnawan, S.T., M.Eng., C.WS. di lokasi mitra terutama kelompok Pengelola Air Bersih (PAB), berupa sistem pengolahan air siap minum dengan Water Softener System dimana air baku di Filtrasi melalui media Ion Exchanger untuk mengikat kandungan kapur dan hasilnya disempurnakan menggunakan media Micro Membrane Filter hasil uji laboratorium yang dilakukan di Universitas Akprind Indonesia menunjukkan nilai kesadahan menjadi 34,2 mg/L.\r\n\r\nSelanjutnya, untuk membunuh bakteri pathogen (E-coli dan coliform), air hasil olahan disterilisasi menggunakan injeksi Ozon dan UV Sterlizer sehingga air menjadi lebih aman untuk diolah dan digunakan untuk keperluan dapur yaitu masak dan minum.\r\n\r\nBerdasarkan laporan dari PAB, telah dilakukan uji rasa pada air yang sudah menggunakan water softener system, ke beberapa relawan yang sudah disepakati berdasarkan SOP yang sudah ditentukan untuk meminum air hasil olahan dan kemudian dikonsumsi dirumah menunjukkan bahwa:\r\n\r\n1.AKD: ada sdikit manis sprti degan, sdh habis 15 liter. Masak Sayur bening jadi kerasa lebih enak.\r\n\r\n2.ME: sama dengan atas, habis 25 liter, tidak ada keluhan kerasa anyang-anyangen, pilek.\r\n\r\n3.TFk: sama dengan atas, habis 1 liter\r\n\r\n4.BSH: sama dengan atas, habis 0,5 liter\r\n\r\n5.SY: seger.\r\n\r\n6.ZA: belum memberikan informasi\r\n\r\n7.Mhd: belum memberikan informasi.\r\n\r\nSelain itu proses uji rasa ini juga dalam pengawasan pihak terkait yang bekerja sama dengan tim Kosabangsa. \"Pengawasan ini dilakukan terus menerus sampai minimal ada 30 orang yang sudah melakukan uji rasa. Sehingga nanti air yang sudah diolah akan siap untuk menjadi air yang memiliki nilai ekonomi dan siap untuk dijual,\" kata Prof Ema.\r\nhttps://rejogja.republika.co.id/berita/snc8ex291/program-kosabangsa-amikom-dan-akprind-implementasikan-inovasi-teknologi-pada-pab', '30112024191856_674b02b01b88e.jpg', '2024-11-30 12:18:56');
