(1, 'Reynald Aryansyah', 'cuprut97@gmail.com', '\"Saya sangat menikmati perjalanan saya ke Desa Bleberan! Pemandangan alamnya luar biasa, dengan udara segar dan suasana yang tenang. Penduduk setempat sangat ramah dan siap membantu. Saya sangat merekomendasikan tempat ini untuk siapa saja yang ingin melarikan diri sejenak dari hiruk-pikuk kota dan menikmati keindahan alam yang masih asri. Fasilitas yang tersedia juga sangat memadai dan memudahkan kami selama berada di sana. Terima kasih atas pengalaman yang tak terlupakan!\" ðŸŒ¿ðŸžï¸', '2024-12-01 04:25:56'),
